window.bookSummaryJSON = "<p>Things are coming to a head for Ahren and his companions. It is true that they have won the Paladins Fisker and Aluna over to their cause in the campaign against the Adversary, but the Pall Pillar is going through an ominous change. </p> <p>Not realizing that the High Fang Sven has brought his master a gruesome sacrifice, the companions gather quickly in King's Island, where they join the first conclave to be held in centuries. Yet, on their arrival they are confronted with dreadful news: unknown Dark Ones have overrun the tiny country of Hjalgar, whose inhabitants are now in mortal danger. Ahren is now facing his most difficult task, for the Dark Days have returned to Jorath with a vengeance.</p>"; 
